import classes from './Home.module.css';
import image from '../../assets/Drinks.jpeg';
import Header from '../../component/HomeHeader/HomeHeader';

const Home = () => {
  return (
    <div className={classes.Box}>
      <Header />
      <img className={classes.Img} src={image} alt={''} />
    <h2></h2>
    </div>
  );
};

export default Home;
